import React from 'react';
import CoursesList from './component/coursesList/CoursesList';
import { Route, Swith, Redirect} from 'react-router-dom';
import SavedList from './component/savedList/savedList';



function App() {
  return (
    <h1>this redux-list app
      <Navbar/>
      <Swith>
        <Route path='/home' component={CoursesList}/>
        <Route path='/saved' component={SavedList}/>
        <Redirect from='/' to='/home'/>
        <Redirect to='/home'/>
      </Swith>
    </h1>
  );
}

export default App;
